function Info() {
    return (
        <header>
            <h1 className="name">
                Faris <span className="accent">Althibani</span>
            </h1>
            <p className="talent">React Developer</p>
            <p className="website">FarisThibani.Website</p>
        </header>
    )
}

export default Info
